import React from 'react';
import {makeStyles} from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';


const createTableComponent = (props) => {
    const tableHeaders = props.tableHeaders || [];
    const tableData = props.tableData || [];

    return (<Table style={{minWidth: props.width}} aria-label="simple table">
        <TableHead>
            <TableRow key={0}>
                {tableHeaders.map((header, cellIdx) => {
                    return <TableCell key={cellIdx}>{header}</TableCell>;
                })}
            </TableRow>
        </TableHead>
        <TableBody>
            {tableData.map((data, rowIdx) => {
                return <TableRow key={rowIdx}> {Object.keys(data).map((key, cellIdx) => {
                    return <TableCell key={cellIdx}>{data[key]}</TableCell>;
                })}
                </TableRow>
            })}
        </TableBody>
    </Table>);
}

export default function BasicTable(props) {
    const tableComponent = createTableComponent(props);
    return (
        <TableContainer component={Paper}>
            {tableComponent}
        </TableContainer>
    );
}
